import React from 'react';
class ListarPokemon extends  React.Component {
    constructor(props){
        super(props);

        this.state = {
            content: ''
        }
    }

    render() {
        if(this.props.encontrado && this.props.resultado.count == 1){
            return(
                <div>
                    <h4>Nombre: {this.props.resultado.name}</h4>
                    <h5>Id: {this.props.resultado.id}</h5>  
                    <img 
                        src = {this.props.resultado.sprites.front_default} 
                        alt = {this.props.resultado.name} 
                    />
                </div>
            );
        }

        return(
            <div>
            </div>
        );
    };

}
export default ListarPokemon;
